import org.junit.Test;
import sun.misc.BASE64Decoder;
import sun.misc.BASE64Encoder;

import javax.imageio.ImageIO;
import java.awt.image.BufferedImage;
import java.io.ByteArrayInputStream;
import java.io.ByteArrayOutputStream;
import java.io.File;
import java.io.IOException;

/**
 * @author: Convict.Yellow
 * @date: 2020/8/12 16:14
 * @description: AppTest
 */
public class AppTest {

    @Test
    public void base64StrToImage() {
        try {
            String str = "data:image/png;base64,";
            BASE64Decoder decoder = new BASE64Decoder();
            byte[] cutBytes = decoder.decodeBuffer(str.replace("data:image/png;base64,", ""));
            BufferedImage cutBI = ImageIO.read(new ByteArrayInputStream(cutBytes));
            ImageIO.write(cutBI, "png", new File("D:/test2.png"));
        } catch (Exception e) {
            e.printStackTrace();
        }
    }

    @Test
    public void imageToBase64Str() {
        try {
            String imagePath = "D:/test.png";
            BASE64Encoder encoder = new BASE64Encoder();
            BufferedImage bi = ImageIO.read(new File(imagePath));
            ByteArrayOutputStream baos = new ByteArrayOutputStream();
            ImageIO.write(bi, "png", baos);
            byte[] bytes = baos.toByteArray();
            String base64Str = encoder.encodeBuffer(bytes).trim();
            System.out.println(base64Str);
        } catch (IOException e) {
            e.printStackTrace();
        }
    }


}
